import { useEffect, useState } from 'react'
import Prodacts from './Prodact'


function ProdactList(){
    const[prodact,setProdact]=useState([])
    useEffect(()=>{
        fetch("https://fakestoreapi.com/products")
        .then(res=>res.json())
        .then(data=>setProdact(data))
    },[])

    return(
<div className='container mt-4 mb-4'>
<h2 className='text-center'>Our Prodacts</h2>
<div className='row gap-5'>
{prodact.map((Prodact)=>{
return(
<div className='col-lg-3 me-4 col-md-4' key={Prodact.id} >
<Prodacts Prodact={Prodact}/>
</div>
)
})}
</div>
</div>
)}
export default ProdactList
